import React, { useEffect } from 'react';
import {Row,Col} from 'react-bootstrap';
import hindu from "../images/adv2.jpg";
import TOI from "../images/ad3.png";
import db from "../images/ad4.png";
import "../css/dash.css";

function Dashboard()
{
    useEffect()
    {
        var trigger = $('.hamburger'),
            overlay = $('.overlay'),
           isClosed = false;

          trigger.click(function () {
            hamburger_cross();      
          });

          function hamburger_cross() {

            if (isClosed == true) {          
              overlay.hide();
              trigger.removeClass('is-open');
              trigger.addClass('is-closed');
              isClosed = false;
            } else {   
              overlay.show();
              trigger.removeClass('is-closed');
              trigger.addClass('is-open');
              isClosed = true;
            }
        }

        $('[data-toggle="offcanvas"]').click(function () {
              $('#wrapper').toggleClass('toggled');
        });  
    }
    return (
        <div id="wrapper">
            <div class="overlay"></div>

                <nav class="navbar navbar-inverse fixed-top" id="sidebar-wrapper" role="navigation">
                    <ul class="nav sidebar-nav">
                        <div class="sidebar-header">
                            <div class="sidebar-brand">
                                <a href="#">Brand</a>
                            </div>
                        </div>

                        <li><a href="#home">Home</a></li>
                        <li><a href="#about">About</a></li>
                        <li><a href="#events">Events</a></li>
                        <li><a href="#team">Team</a></li>
                        <li class="dropdown">
                        <a href="#works" class="dropdown-toggle"  data-toggle="dropdown">Works <span class="caret"></span></a>
                        <ul class="dropdown-menu animated fadeInLeft" role="menu">
                            <div class="dropdown-header">Dropdown heading</div>
                            <li><a href="#pictures">Pictures</a></li>
                            <li><a href="#videos">Videeos</a></li>
                            <li><a href="#books">Books</a></li>
                            <li><a href="#art">Art</a></li>
                            <li><a href="#awards">Awards</a></li>
                        </ul>
                        </li>
                        <li><a href="#services">Services</a></li>
                        <li><a href="#contact">Contact</a></li>
                        <li><a href="#followme">Follow me</a></li>
                    </ul>
                </nav>
        {/* <!-- /#sidebar-wrapper --> */}

        {/* <!-- Page Content --> */}
        <div id="page-content-wrapper">
            <button type="button" class="hamburger animated fadeInLeft is-closed" data-toggle="offcanvas">
                <span class="hamb-top"></span>
    			<span class="hamb-middle"></span>
				<span class="hamb-bottom"></span>
            </button>
            <div class="container">
                    <Row>
                        <Col lg={6} xl={4} sm={12}>
                            <div id="d">
                                <img src={hindu}></img>
                                <h2>The Hindu</h2>
                                <h3>Price:1000 Rs</h3>
                            </div>
                        </Col>
                        <Col lg={6} xl={4} sm={12}>
                        <img src={TOI}></img>
                            <h2>The Times of India</h2>
                            <h3>Price:1100 Rs</h3>
                        </Col>
                        <Col lg={6} xl={4} sm={12}>
                        <img src={db}></img>
                            <h2>Dainik bhaskar</h2>
                            <h3>Price:1000 Rs</h3>
                        </Col>
                    </Row>
                </div>
        </div>
        {/* <!-- /#page-content-wrapper --> */}

    </div>

    );
}
export default Dashboard;
